import '../styles/Logement.css'
import { Form, useParams } from 'react-router-dom';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import Api from './Api'


function Logement() {
    const data = Api();
    const idUrl = useParams();
    const loge = []
    data.forEach(function (res) {
        if (idUrl.id === res.id) {
            loge.push(res)
        }

    });
    console.log(loge)

    return (
        <div className='kasa-containere-slide'>
            <div>
                {loge.pictures.map((slide) => (
                    <Swiper>
                        <SwiperSlide>
                            <img src={slide.pictures[1]} alt='' className='kasa-image-logement' />
                        </SwiperSlide>
                        <SwiperSlide>
                            <img src={slide.pictures[2]} alt='' className='kasa-image-logement' />
                        </SwiperSlide>
                    </Swiper>
                ))}
            </div>
        </div>

    )

}

export default Logement
